import "./Blog.css"
import Blogitem from "../components/Blogitem"

export default function Blog(props) {
    return (
        <>
            <h1 className="headuser">All Blogs</h1>
            <div className="row my-3">
                {blog.map((blogs) => {
                    return <Blogitem blogs={blogs} />
                })}
            </div>
        </>
    )
}
